import React from 'react';
import styled from 'styled-components';
import logo from '../assets/images/tripsoda_icon.png'

export default function Result({ location }) {
    console.log(location.state.list);
    
    let total = 0;

    for( let num of location.state.list){
        total = total + num
    }

    console.log(total);

    return (
        // <div>결과</div>
        <ConsultStyled>            
            <div className="logo">
                <img src={logo}/>
            </div>
        </ConsultStyled>
    )

};
const ConsultStyled = styled.div`
    max-width: 752px;
    margin: 0 auto;
    width: 100%;
    box-sizing: border-box;
    padding: 0 10px;


    .logo {
        display: flex;
        justify-content: center;
        padding-top: 30px;
    }
`;
